import { API, wrapPromise } from 'utils/api';

function fetchBaseProfile({ userId }) {
	return API.get(`web/profile/${userId}`);
}

// function fetchTopbanner() {
// 	return API.get('web/jobsFeed/advertisments');
// }

export const fetchUserProfile = () => {
	const baseProfile = fetchBaseProfile();
	return {
		baseProfile: wrapPromise(baseProfile),
	};
};
